import React from 'react';

const QuestionCardCOntent = ({question}) => {
    return(
    <div>
        <Typography variant="h6" color="textSecondary" component="p">
            Question: {question.subtitle}
        </Typography>
        <Typography variant="h6" color="textSecondary" component="p">
            Votes : {question.upVote}
        </Typography>
    </div>
    )
}

export default QuestionCardCOntent
